Page({

  data: {
    isAttention: true,
    i: 0,
    // isFollow:false,
    myFollowList: [
      {
        id: 1,
        name: '凉生有幸',
        tag: '凉风有幸,秋月无边',
        src: 'data:image/jpeg;base64,',
        isFollow: true
      },
      {
        id: 2,
        name: '总喜欢你',
        tag: '我喜欢看飞鸟集',
        src: 'data:image/jpeg;base64,',
        isFollow: true
      },
      {
        id: 3,
        name: '竹盖子',
        tag: '前方是绝路,希望在转角',
        src: 'data:image/jpeg;base64,',
        isFollow: true
      },
      {
        id: 4,
        name: '业余正常人',
        tag: '冲天的橙子',
        src: 'data:image/jpeg;base64,',
        isFollow: true
      }
    ]
  },
  // 可以id来进行判断
  toAttention (e) {
    // 获取点击的id
    let index = e.currentTarget.dataset.id - 1
    let isFollow = this.data.myFollowList[index].isFollow;
    // 如果取关了就直接关注
    if (!this.data.myFollowList[index].isFollow) {
      this.setData({
        [`myFollowList[${index}].isFollow`]: true
      })
      return
    }
    // 询问是否确定取关，并操作
    wx.showModal({
      title: '确定要取关他吗？',
      content: '',
      showCancel: true,
      cancelText: '取消',
      cancelColor: '#000000',
      confirmText: '确定',
      confirmColor: '#F76E6D',
      success: (result) => {
        if (result.confirm) {
          this.setData({
            // data对象中属性改变的写法
            [`myFollowList[${index}].isFollow`]: !isFollow
          })
        }
      },
    })
  },

})